import React from "react";
import ReactDOM from "react-dom";

var name = "Maninder";
var id = "1972011";

ReactDOM.render(
  <>
    <h3>{ `My Name is ${ name } ${ id } Yo ` }</h3>
    <h4>Addition is { 4%2 }</h4>
  </>,
  document.getElementById("root")
);
